import React, { useState, useEffect } from "react";

const Customers = () => {
  let [customer, setCustomer] = useState([]);

  useEffect(() => {
    getCustomer();
  }, []);

  let getCustomer = async () => {
    let response = await fetch("http://127.0.0.1:8000/api/customers/");
    let data = await response.json();
    setCustomer(data);
  };

  return (
    <div>
      <div>
        {customer.map((customered, index) => (
          <h3 key={index}>{customered}</h3>
        ))}
      </div>
    </div>
  );
};

export default test;
